DROP TABLE IF EXISTS `dt_page`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `dt_page` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `cid` int(11) NOT NULL COMMENT '分类',
  `title` varchar(100) DEFAULT NULL,
  `author` varchar(20) DEFAULT NULL,
  `sort` int(11) NOT NULL DEFAULT '0',
  `price` decimal(10,2) DEFAULT '0.00',
  `thumb` varchar(255) DEFAULT NULL,
  `thumbs` varchar(1024) DEFAULT NULL,
  `info` varchar(255) DEFAULT NULL,
  `content` text,
  `create_time` int(10) NOT NULL,
  `update_time` int(10) DEFAULT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0-不显示 1-显示',
  `recommend` tinyint(1) DEFAULT '0' COMMENT '推荐',
  `recommend2` tinyint(1) DEFAULT '0' COMMENT '内容推荐',
  `view` int(11) DEFAULT '0' COMMENT '浏览次数',
  `day_view` int(11) DEFAULT '0' COMMENT '日浏览',
  `day_view_date` date DEFAULT NULL COMMENT '最近一日浏览',
  `zan` int(11) DEFAULT '0',
  `cai` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

