INSERT INTO `dt_page` VALUES (1,0,'新手指南及常见问题 ',NULL,0,0.00,NULL,NULL,NULL,'<p>\r\n	新手指南/常见问题\r\n</p>\r\n<p>\r\n	<span style=\"color:#EE33EE;\">*做任务前确保做任务的账号上有作品，有头像有名字。</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#EE33EE;\">提醒：用户可以通过任务中心，快速分辨，任务级别。</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#EE33EE;\"> \r\n	<table class=\"MsoNormalTable ke-zeroborder\" border=\"0\" cellspacing=\"0\" style=\"width:256.15pt;border:none;\">\r\n		<tbody>\r\n			<tr>\r\n				<td width=\"68\" valign=\"center\" style=\"border:none;\">\r\n					<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;vertical-align:middle;\">\r\n						<span style=\"font-family:黑体;color:#FF0000;\">账户级别</span><span style=\"font-family:黑体;color:#FF0000;\"></span> \r\n					</p>\r\n				</td>\r\n				<td width=\"68\" valign=\"center\" style=\"border:none;\">\r\n					<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;vertical-align:middle;\">\r\n						<span style=\"font-family:黑体;color:#FF0000;\">价格</span><span style=\"font-family:黑体;color:#FF0000;\"></span> \r\n					</p>\r\n				</td>\r\n				<td width=\"68\" valign=\"center\" style=\"border:none;\">\r\n					<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;vertical-align:middle;\">\r\n						<span style=\"font-family:黑体;color:#FF0000;\">保底奖金</span><span style=\"font-family:黑体;color:#FF0000;\"></span> \r\n					</p>\r\n				</td>\r\n				<td width=\"68\" valign=\"center\" style=\"border:none;\">\r\n					<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;vertical-align:middle;\">\r\n						<span style=\"font-family:黑体;color:#FF0000;\">刷单数量</span><span style=\"font-family:黑体;color:#FF0000;\"></span> \r\n					</p>\r\n				</td>\r\n				<td width=\"67\" valign=\"center\" style=\"border:none;\">\r\n					<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;vertical-align:middle;\">\r\n						<span style=\"font-family:黑体;color:#FF0000;\">任务金额</span><span style=\"font-family:黑体;color:#FF0000;\"></span> \r\n				