\">二：尊享会员</span><span style=\"color:#EE33EE;\">/高级代理，享受无线级会员奖。</span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	尊享会员：\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	①：直推一名奖70元。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	②：间推一名奖40元。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	③：间间推一名奖25元。&nbsp;<span style=\"background-color:#000000;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	④：四级后可得保底收益20元。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"background-color:#E53333;\">举例：按照每个级别推荐10位，推荐四级可赚229700元推荐奖！</span><span style=\"background-color:#E53333;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"background-color:#E53333;\">答：花费</span><span style=\"background-color:#E53333;\">1800元升级尊享会员，每天做任务可赚200元。</span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	高级代理：\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	①：直推第一级100元。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	②：间推第二级奖70元。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	③：间间推第三级奖55元。&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	④：四级后可得保底收益50元。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"background-color:#E53333;\">举例：按照每个级别推荐10位，推荐四级可赚563000元推荐奖！</span><span style=\"background-color:#E53333;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"background-color:#E53333;\">答：花费</span><span style=\"background-color:#E53333;\">6800元升级高级代理，每天做任务可赚300元。</span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"color:#EE33EE;\">三：任务中心是什么？</span>\r\n</p>\r\n<p>\r\n	答：任务中心可快速分辨任务等级，四项等级，高级可做低级任务\r\n</p>\r\n<p>\r\n	低级不可做高级任务！\r\n</p>\r\n<p>\r\n	<span style=\"color:#EE33EE;\">四：复制抖音链接后打开抖音没有弹出任务框怎么办？</span>\r\n</p>\r\n<p>\r\n	答：此情况为抖音官方问题，退出抖音重新进入或者等待10秒。\r\n</p>\r\n<p>\r\n	<span style=\"color:#EE33EE;\">五：遇见作品已删除，或者禁作者关注的人才可评论怎么完成任务？</span>\r\n</p>\r\n<p>\r\n	答：遇见类似情况放弃任务，如乱传截图会导致扣<span style=\"color:#EE33EE;\">信誉分</span>。\r\n</p>\r\n<p>\r\n	<span style=\"color:#EE33EE;\">六：完成任务后多久审核通过？</span>\r\n</p>\r\n<p>\r\n	答：完成任务上传截图提交任务后系统24小时内进行机审。\r\n</p>\r\n<p>\r\n	<span style=\"color:#EE33EE;\">七：提现多久到账，没有到账怎么办？</span>\r\n</p>\r\n<p>\r\n	答：提现二十四小时内自动到账，未遇见未到账的情况\r\n</p>\r\n<p>\r\n	<span style=\"color:#EE33EE;\">八：什么情况下会被永久封号？</span>\r\n</p>\r\n<p>\r\n	①：完成关注任务后取关者，永久封号。\r\n</p>\r\n<p>\r\n	②：评论任务复制他人评论者，永久封号。\r\n</p>\r\n<p>\r\n	③：评论任务使用同一句话者，永久封号。\r\n</p>\r\n<p>\r\n	④：评论敷衍了事，大部分字体不够，永久封号。\r\n</p>\r\n<p>\r\n	⑤：随意乱上传任务截图，扰乱正常执行者，永久封号。\r\n</p>\r\n<p>\r\n	⑥：账户<span style=\"color:#EE33EE;\">信誉分</span>达到于150者，永久封号。\r\n</p>',1571589422,1571589422,1,0,0,0,0,'0000-00-00',0,0);
