  `tasklb` tinyint(1) DEFAULT '1',
  `taskuser` varchar(255) NOT NULL,
  `uid` int(11) DEFAULT NULL,
  `total_price` decimal(18,2) DEFAULT NULL COMMENT '任务总价',
  `is_shouji` int(11) DEFAULT NULL COMMENT '是否手机认证',
